import React from "react";

const HomePage = () => {
  return (
    <div className="home-container">
      <h1>Formula 1 Simulation</h1>
      <p>
        Formula 1 este cel mai spectaculos sport cu motor din lume. 
        Această aplicație vă permite să simulați performanța unui monopost în funcție de echipă, model, circuit și alte variabile.
      </p>
      <p>
        Accesați pagina de <a href="/simulate">Simulare</a> pentru a testa aplicația 
        sau pagina de <a href="/info">Informații</a> pentru detalii despre pneuri, downforce și circuite.
      </p>
    </div>
  );
};

export default HomePage;
